import Home from "../frontend/pages/home/home";
import Dashboard from "../front_end/pages/Dash_board";  // Import Dashboard
import NotFound from "../frontend/pages/notFound";

const FrontendRoute = [
    { path: '/', component: Home },
    { path: '/dashboard', component: Dashboard }, // Đã có import
    { path: '*', component: NotFound },
];

export default FrontendRoute;
